import React, {useEffect, useState} from "react"
import axios from "axios"

import {useNavigate, Link} from "react-router-dom"

function Signup() {
    const[email, setEmail] = useState('')
    const [password, setPassword] = useState('')
    const [firstname, setFirstName] = useState('')
    const [lastname , setLastName] = useState('')

    async function handleSubmit(e) {
        e.preventDefault();

        try {
            await axios.post("http://localhost:5555/signup", {  // Correct backend URL
                firstname,
                lastname,
                email,
                password
            });

            // Handle successful signup, e.g., navigate to a login page or show a success message

        } catch (err) {
            console.error(err);
        }
    }
    return(
        <div className = "login">
            <h1>Sign up</h1>
            <form onSubmit={handleSubmit}>
                <input type = "email" onChange={(e) => {setEmail(e.target.value)}} placeholder="email"/>
                <input type = "password" onChange={(e) => {setEmail(e.target.value)}} placeholder="password"/>
                <input type = "firstname" onChange={(e) => {setFirstName(e.target.value)}} placeholder="firstname"/>
                <input type = "lastname" onChange={(e) => {setLastName(e.target.value)}} placeholder="lastname"/>
                <input type = "submit" value = "Sign Up"/>
            </form>


            <Link to="/signup">Signup Page</Link>
        </div>
    )
}
export default Signup
